ns16:scriptTask.ns16:script:
tw.local.defaultText = "This is a sample coach for the following activity: ";
tw.local.activityName = "Default Responsive Human Service";
if (!!tw.system.processInstance) {
var task = tw.system.processInstance.task;
if (!!task) {
tw.local.taskId = task.id;
tw.local.subject = task.subject;
tw.local.userName = task.owner;
tw.local.taskNarrative = task.narrative;
if (!!task.processActivityName)
tw.local.activityName = task.processActivityName;
if (!!task.processActivityDescription)
tw.local.activityDescription = task.processActivityDescription;
var instance = tw.system.processInstance;
if (!!instance) {
var process = instance.process;
tw.local.bpdInstanceId = instance.id;
tw.local.bpdInstanceName = instance.name;
tw.local.bpdName = process.name;
tw.local.bpdDescription = process.description;
}
}
}

tw.local.htmlNarrative = tw.local.taskNarrative.replace(/(\r\n|\n|\r)/g,"<br />");
